import React from 'react';
import Navigation from '../composants/Navigation';
import perroquet from '../image/perroquet-zoo.png'

const Accueil = () => {
    return (
        <div>
            <Navigation />
            <img src={perroquet} width="500" height="auto" />
            <h1>page acccueil</h1>
        </div>
    );
};

export default Accueil;
